import Vue from 'vue'
import Router from 'vue-router'
import Login from './views/Login.vue'
import storeForm from './views/storeForm.vue'
import adminStores from './views/adminStores.vue'
import storeRequest from './views/storeRequest.vue'
import storeProfile from './views/storeProfile.vue'
import storePromotion from './views/storePromotion.vue'
import inactivePromotion from './views/inactivePromotion.vue'



Vue.use(Router)

export default new Router({
  routes: [{
      path: '/',
      name: 'login',
      component: Login
    },
    {
      path: '/storeForm',
      name: 'storeForm',
      component: storeForm
    },
    {
      path: '/adminStores',
      name: 'adminStores',
      component: adminStores
    },
    {
      path: '/storeRequest',
      name: 'storeRequest',
      component: storeRequest
    },
    {
      path: '/storeProfile',
      name: 'storeProfile',
      component: storeProfile
    },
    {
      path: '/storePromotion',
      name: 'storePromorion',
      component: storePromotion
    },
    {
      path: '/inactivePromotion',
      name: 'inactivePromorion',
      component: inactivePromotion
    }
  ]
})
